import React from 'react';

const TaskList = ({ tasks }) => {
    return (
        <div>
            <h2>Task List</h2>
            {/* Вывод списка задач */}
            {tasks.map(task => (
                <div key={task.id}>
                    <h3>{task.title}</h3>
                    <p>Description: {task.description}</p>
                    <p>Due Date: {task.due_date}</p>
                    <p>Priority: {task.priority}</p>
                    <p>Status: {task.status}</p>
                </div>
            ))}
        </div>
    );
};

export default TaskList;
